        public OperationResult Create(Employee entity)
        {
            try
            {
                employees.Add(entity);
                return OperationResult.Success(entity);
            }
            catch (Exception ex)
            {
                return OperationResult.Failure(ex.Message);
            }
        }

        public OperationResult Delete(Employee entity)
        {
            try
            {
                employees.Remove(entity);
                return OperationResult.Success(entity);
            }
            catch (Exception ex)
            {
                return OperationResult.Failure(ex.Message);
            }
        }

        public OperationResult Get(Employee entity)
        {
            try
            {
                var e = employees.FirstOrDefault(entity);
                if (e != null)
                {
                    employees.Remove(e);
                    employees.Add(entity);
                    return OperationResult.Success(entity);
                } 
                else
                {
                    return OperationResult.Failure($"Update operation failed: Entity (id:{entity.Id}) not found.");
                }
            }
            catch (Exception ex)
            {
                return OperationResult.Failure(ex.Message);
            }
        }

        public IQueryable<Employee> GetAll()
        {
            return employees.AsQueryable();
        }

        public OperationResult Update(Employee entity)
        {
            try
            {
                var e = employees.FirstOrDefault(entity);
                if (e != null)
                {
                    return OperationResult.Success(e);
                }
                else
                {
                    return OperationResult.Failure($"Entity id:{entity.Id} not found.");
                }
            }
            catch (Exception ex)
            {
                return OperationResult.Failure(ex.Message);
            }
        }
    }
